Wiki Info: Under the Dome is an American science fiction drama television series that premiered on CBS on June 24, 2013. The series was developed by Brian K. Vaughan and based on the novel of the same name by Stephen King.

Plot: An invisible and mysterious force field descends upon a small fictional town in the United States, trapping residents inside, cut off from the rest of civilization. The trapped townsfolk must discover the secrets and purpose of the &quot;dome&quot; and it's origins, while coming to learn more than they ever knew about each other under the dome.

